tinsert(l,m(213,g({lvl=13,description="Ragefire Chasm consists of a network of volcanic caverns that lie below the orcs' new capital city of Orgrimmar. Recently, rumors have spread that a cult loyal to the demonic Shadow Council has taken up residence within the Chasm's fiery depths. This cult, known as the Burning Blade, threatens the very sovereignty of Durotar. Many believe that the orc Warchief, Thrall, is aware of the Blade's existence and has chosen not to destroy it in the hopes that its members might lead him straight to the Shadow Council. Either way, the dark powers emanating from Ragefire Chasm could undo all that the orcs have fought to attain"},{n(-17,{q(5726,{qgs={4949},lvl=9,coords={a11},r=1}),q(5727,{qgs={4949},lvl=9,coords={a11},sourceQuests={5726},r=1}),q(5728,{qgs={4949},lvl=9,coords={a11},sourceQuests={5727},r=1}),q(5729,{qgs={4949},lvl=9,coords={a11},sourceQuests={5728},r=1}),q(5730,g({qgs={3216},lvl=9,coords={{49.6,50.6}},sourceQuests={5729},r=1},{i(15424),i(15445),i(15443),i(15444)})),q(5724,g({qgs={11834},lvl=9,sourceQuests={5722},r=1},{i(15452),i(15453)})),q(5722,{qgs={11833},lvl=9,coords={{70.6,31.4}},r=1}),q(5761,{qgs={3216},lvl=9,coords={{49.6,50.6}},sourceQuests={5727},r=1}),q(5723,{qgs={11833},lvl=9,coords={{70.6,31.4}},r=1}),q(5725,g({qgs={2425},lvl=9,coords={{56.2,91.8}},r=1},{i(15450),i(15451),i(15449)}))}),n(11517,{i(2589)}),n(11520,{i(14540),i(14145),i(14149),i(14148)}),n(11518,{i(14151),i(14150),i(14147)}),n(11519,{description="Drops nothing of note."})})));
tinsert(l,m(310,g({lvl=14,description="During the Third War, the wizards of the Kirin Tor battled against the undead armies of the Scourge. When the wizards of Dalaran died in battle, they would rise soon after - adding their former might to the growing Scourge. Frustrated by their lack of progress (and against the advice of his peers) the Archmage, Arugal elected to summon extra-dimensional entities to bolster Dalaran's diminishing ranks. Arugal's summoning brought the ravenous worgen into the world of Azeroth. The feral wolf-men slaughtered not only the Scourge, but quickly turned on the wizards themselves. The worgen sieged the keep of the noble, Baron Silverlaine. Situated above the tiny hamlet of Pyrewood, the keep quickly fell into shadow and ruin. Driven mad with guilt, Arugal adopted the worgen as his children and retreated to the newly dubbed 'Shadowfang Keep'. It's said he still resides there, protected by his massive pet, Fenrus - and haunted by the vengeful ghost of Baron Silverlaine."},{n(-17,{q(1014,g({qgs={1938},lvl=18,coords={{44.2,39.8}},r=1},{i(6414)})),q(1098,g({qgs={1952},lvl=18,coords={{43.4,40.8}},r=1},{i(3324)})),q(1013,g({qgs={2934},lvl=16,coords={{54,54.6}},r=1},{i(4534),i(6335)})),q(1740,g({qgs={6247},c=a2,coords={{49.2,57.2}},lvl=20},{i(6898),i(15109)})),q(1794,{qgs={5149},c=a1,lvl=20,races=a4,coords={{23.6,6.4}}}),q(1793,{qgs={6171},c=a1,lvl=20,races=a5,coords={{39.8,30.8}}}),i(6776,{coords={{39.8,30.8}},qgs={6171},lvl=20,sourceQuests={1793,1794},races=a10,questID=1649,c=a1}),q(1650,{qgs={6171},coords={{39.8,30.8}},c=a1,lvl=20,races=a10,sourceQuests={1649}}),q(1651,{qgs={6182},coords={{42.4,88.4}},c=a1,lvl=20,races=a10,sourceQuests={1650}}),q(1652,g({coords={{39.8,30.8}},qgs={6171},c=a1,lvl=20,races=a10,sourceQuests={1651}},{sp(5502),i(9607)})),q(1653,{qgs={6171},coords={{39.8,30.8}},c=a1,lvl=20,races=a10,sourceQuests={1652}}),q(1654,{qgs={6181},coords={{52.6,36.8}},c=a1,lvl=20,races=a10,sourceQuests={1653}}),q(1806,g({coords={{52.6,36.8}