tinsert(l,m(225,g({lvl=15,description="The Stockade is a high-security prison complex, hidden beneath the canal district of Stormwind city. Presided over by Warden Thelwater, the Stockade is home to petty crooks, political insurgents, murderers and a score of the most dangerous criminals in the land. Recently, a prisoner-led revolt has resulted in a state of pandemonium within the stockade - where the guards have been driven out and the convicts roam free. Warden Thelwater has managed to escape the holding area and is currently enlisting brave thrill-seekers to venture into the prison and kill the uprising's mastermind - the cunning felon, Bazil Thredd.",coords={{39.77,54.21,1453}}},{n(-17,{q(377,g({qgs={270},lvl=26,maps={1431},coords={{72,46.8,1431}},r=2},{i(2906),i(2033)})),q(387,{qgs={1719},lvl=22,maps={1453},coords={{39.77,54.21,1453}},r=2}),q(388,{qgs={1721},lvl=22,maps={1453},coords={{73.2,55.2,1453}},r=2}),q(378,g({qgs={1074},lvl=25,maps={1437},coords={{49.8,18.2,1437}},r=2},{i(1264),i(3562)})),q(391,{qgs={1719},coords={{39.77,54.21,1453}},lvl=16,maps={1453},sourceQuests={389},r=2}),q(386,g({qgs={859},lvl=22,maps={1433},coords={{26,43,1433}},r=2},{i(1317),i(3400)}))}),n(0,{i(1076)}),n(1720,g({description="This is a rare that was not always present."},{i(2942),i(3228),i(2941),i(4306)})),n(1666,{i(3640),i(2280),i(4306)}),n(1663,{i(3628),i(2909),i(4306)}),n(1717,{i(4306)}),n(1696,{i(3630),i(2592)}),n(1716,{i(2926),i(2909),i(4306)})})));
